import React  from 'react';
import { Link } from 'react-router-dom'
import getResults from './Utilities/getresults'
import './stylesheet.scss';

const Scoreboard = props => {
    console.log(props)
    const results  = getResults(props.contest, props.level, props.county);
    return <table id="scoreboard" style={{width: "100%"}}>
        <tr>
            {results["head"].map(cell => (<th>{cell}</th>))}
        </tr>
        {
            results["body"].map( entry =>
                (<tr>{entry.map(cell => (<td>{cell}</td>))}</tr>)
            )
        }
    </table>
}

export default Scoreboard;
